import './ExpenseItem.css'
function ExpenseItem() {
  return (
    <section>
      <article>March 28th 2021</article>
      <article>
        <h2>Car Insurance</h2>
        <article>$294.67</article>
      </article>
    </section>
  );
}

export default ExpenseItem;
